import React from 'react';
import SignUpForm from './SignUpForm';
import LoginForm from './LoginForm';
import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';

class App extends React.Component {
  render() {
    return ( <
      div className = "ui container" >
      <
      BrowserRouter >

      <
      Switch >
      <
      Route path = '/SignUp'
      component = {
        SignUpForm
      }
      /> <
      Route path = '/Login'
      component = {
        LoginForm
      }
      />             <
      /Switch>    <
      /BrowserRouter> <
      /div>
    );
  }
}

export default App;
